import React from "react";

export default function AddTask() {
  return (
    <div className="mt-16 top-32 text-black w-5/6 h-screen float-right bg-slate-200 ">
      <div className="w-full ">
        <div class="grid grid-cols-4 gap-4">
          <div>1</div>
          <div>2</div>
          <div>3</div>
          <div>4</div>
          <div>5</div>
        </div>
      </div>
    </div>
  );
}
